static QString stripEmptyLines(const char *s)
{
  int result=0,p=0;
  for (;;)
  {
    int c;
    while ((c=s[p]) && (c==' ' || c=='\t' || c=='\r')) p++;
    if (s[p]=='\n') result=++p; else break;
  }
  return &s[result];
}

